import React from 'react';
import { StyleSheet, Text, View } from 'react-native';

 function createDates() {
  return (
    <View style={styles.container}>
          <TextInput placeholder= "Identificacion"></TextInput>
          <TextInput placeholder= "Nombre"></TextInput>
          <TextInput placeholder= "Apellido"></TextInput>
          <TextInput placeholder= "Fecha de nacimiento"></TextInput>
          <TextInput placeholder= "Ciudad"></TextInput>
          <TextInput placeholder= "Barrio"></TextInput>
          <TextInput placeholder= "Telefono"></TextInput>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    flexDirection:'column',

  },
});

export default createDates;
